import React from 'react'

const Weather = ({min, max, weatherType, weatherKey}) => {
    return (
        <div>
            
            <div><img alt='weatherType'
            src={`https://developer.accuweather.com/sites/default/files/${weatherKey}-s.png`} /></div>
            <div>{min} {max}</div>
        </div>
    )
}

export default Weather
